import {
  GET_EMPLOYEES_LIST,
  GET_SINGLE_EMPLOYEE,
  ADD_EMPLOYEE,
  ADD_EMPLOYEES_LIST,
  EDIT_EMPLOYEE,
  GET_PROJECTS,
  GET_LOCATIONS,
} from "./employeeTypes";

export const getEmployeeList = (params) => {
  return {
    type: GET_EMPLOYEES_LIST,
    payload: params,
  };
};
